import React, { Component } from 'react'
import { Redirect } from 'react-router-dom';

export default class Admin extends Component {

    constructor(props) {
        super(props);
        this.state = {
            email: '',
            password: '',
            role: 'Admin'
        };
        this.handleSubmit = this.handleSubmit.bind(this);
    }


    componentDidMount() {
        navigator.geolocation.getCurrentPosition(function (position) {
            console.log("Latitude is :", position.coords.latitude);
            console.log("Longitude is :", position.coords.longitude);
        });
    }
    handleChange(changeObject) {
        this.setState(changeObject)
    }
    handleSubmit(event) {
        event.preventDefault();
        fetch('http://localhost:3000/admin/authenticate', {
            method: 'POST',
            headers: {
                Accept: 'application/json',
                'Content-Type': 'application/json',
            },
            body: JSON.stringify(this.state)
        }).then(res => {
            localStorage.setItem('access_token', res.accessToken);
            <Redirect to="/admin/dashboard" />
        })
        .catch(error => {
            console.log(error)
        })
    }

    // if(isLoggedIn) {
    //     return <Redirect to="/" />;
    // }

    render() {
        return (
            <div>
                <div className="wrapper fadeInDown">
                    <div id="formContent">
                        {/* Tabs Titles */}
                        {/* Icon */}
                        <div className="fadeIn first">
                            <h1>Sign In</h1>
                            {/* <img src="../img/lock.jpg" id="icon" alt="User Icon" /> */}
                        </div>
                        {/* Login Form */}
                        <form onSubmit={this.handleSubmit}>
                            <input type="email" value={this.state.name} onChange={(e) => this.handleChange({ email: e.target.value })} required id="login" className="fadeIn email second" name="email" placeholder="login" />
                            <input type="password" value={this.state.name} onChange={(e) => this.handleChange({ password: e.target.value })} required id="password" className="fadeIn password third" name="password" placeholder="password" />
                            <input type="submit" className="fadeIn fourth" defaultValue="Log In" />
                        </form>
                        {/* Remind Passowrd */}
                        <div id="formFooter">
                            <a className="underlineHover" href="#">Forgot Password?</a>
                        </div>
                    </div>
                </div>
            </div>

        )
    }
}
